import { Children } from 'react';

var isPlaceholder = function isPlaceholder(child) {
  return child && child.props && child.props.text === 'child placeholder';
};

var isOverride = function isOverride(child) {
  return child && child.props && typeof child.props.slot === 'string' && child.props.slot.length > 0;
};

var isEmptyChildren = function isEmptyChildren(children) {
  return !Children.toArray(children).some(function (child) {
    return child && !isPlaceholder(child) && !isOverride(child);
  });
};

export default isEmptyChildren;
